import { Link } from "react-router-dom";
import courses from "../data/courses";

const Courses = () => {
  return (
    <>
      <h1>Courses</h1>;
      {courses.map((course) => (
        <div key={course.id}>
        <Link
        //   to={course.slug} className="courseLink"
        //   to={course.id.toString()} className="courseLink"
        >
          {course.title}
        </Link>
        </div>
      ))}
    </>
  );
};

export default Courses;
